:"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 18, 2, '', '', 1, 221, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(133, 240, 'Typography', 'typography', '<p> </p>\r\n<!-- Headings\r\n================================================== -->\r\n<div class="yt-typography">\r\n<div class="page-header">\r\n<h1>Headings</h1>\r\n</div>\r\n<div class="accordion-body in">\r\n<section id="Headings">\r\n<p>All HTML headings, <code>&lt;h1&gt;</code> through <code>&lt;h6&gt;</code> are available.</p>\r\n<div class="bs-docs-example">\r\n<h1>h1. Heading 1</h1>\r\n<h2>h2. Heading 2</h2>\r\n<h3>h3. Heading 3</h3>\r\n<h4>h4. Heading 4</h4>\r\n<h5>h5. Heading 5</h5>\r\n<h6>h6. Heading 6</h6>\r\n</div>\r\n<h2 id="body-copy">Body copy</h2>\r\n<p>Bootstrap''s global default <code>font-size</code> is <strong>14px</strong>, with a <code>line-height</code> of <strong>20px</strong>. This is applied to the <code>&lt;body&gt;</code> and all paragraphs. In addition, <code>&lt;p&gt;</code> (paragraphs) receive a bottom margin of half their line-height (10px by default).</p>\r\n<div class="bs-docs-example">\r\n<p>Nullam quis risus eget urna mollis ornare vel eu leo. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Nullam id dolor id nibh ultricies vehicula.</p>\r\n<p>Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec ullamcorper nulla non metus auctor fringilla. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Donec ullamcorper nulla non metus auctor fringilla.</p>\r\n<p>Maecenas sed diam eget risus varius blandit sit amet non magna. Donec id elit non mi porta gravida at eget metus. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.</p>\r\n</div>\r\n<pre class="prettyprint"><span class="tag">&lt;p&gt;</span><span class="pln">...</span><span class="tag">&lt;/p&gt;</span></pre>\r\n<h3>Lead body copy</h3>\r\n<p>Make a paragraph stand out by adding <code>.lead</code>.</p>\r\n<div class="bs-docs-example">\r\n<p class="lead">Vivamus sagittis lacus vel augue laoreet rutrum faucibus dolor auctor. Duis mollis, est non commodo luctus.</p>\r\n</div>\r\n<pre class="prettyprint"><span class="tag">&lt;p</span><span class="atn">class</span><span class="pun">=</span><span class="atv">"lead"</span><span class="tag">&gt;</span><span class="pln">...</span><span class="tag">&lt;/p&gt;</span></pre>\r\n<h3>Built with Less</h3>\r\n<p>The typographic scale is based on two LESS variables in <strong>variables.less</strong>: <code>@baseFontSize</code> and <code>@baseLineHeight</code>. The first is the base font-size used throughout and the second is the base line-height. We use those variables and some simple math to create the margins, paddings, and line-heights of all our type and more. Customize them and Bootstrap adapts.</p>\r\n<hr class="bs-docs-separator" />\r\n<h2 id="emphasis">Emphasis</h2>\r\n<p>Make use of HTML''s default emphasis tags with lightweight styles.</p>\r\n<h3><code>&lt;small&gt;</code></h3>\r\n<p>For de-emphasizing inline or blocks of text, <small>use the small tag.</small></p>\r\n<div class="bs-docs-example">\r\n<p><small>This line of text is meant to be treated as fine print.</small></p>\r\n</div>\r\n<pre class="prettyprint">&lt;p&gt;\r\n     &lt;small&gt;This line of text is meant to be treated as fine print. &lt;/small&gt;\r\n&lt;/p&gt;</pre>\r\n<h3>Bold</h3>\r\n<p>For emphasizing a snippet of text with a heavier font-weight.</p>\r\n<div class="bs-docs-example">\r\n<p>The following snippet of text is <strong>rendered as bold text</strong>.</p>\r\n</div>\r\n<pre class="prettyprint"><span class="tag">&lt;strong&gt;</span><span class="pln">rendered as bold text</span><span class="tag">&lt;/strong&gt;</span></pre>\r\n<h3>Italics</h3>\r\n<p>For emphasizing a snippet of text with italics.</p>\r\n<div class="bs-docs-example">\r\n<p>The following snippet of text is <em>rendered as italicized text</em>.</p>\r\n</div>\r\n<pre class="prettyprint"><span class="tag">&lt;em&gt;</span><span class="pln">rendered as italicized text</span><span class="tag">&lt;/em&gt;</span></pre>\r\n<p><span class="label label-info">Heads up!</span> Feel free to use <code>&lt;b&gt;</code> and <code>&lt;i&gt;</code> in HTML5. <code>&lt;b&gt;</code> is meant to highlight words or phrases without conveying additional importance while <code>&lt;i&gt;</code> is mostly for voice, technical terms, etc.</p>\r\n<h3>Emphasis classes</h3>\r\n<p>Convey meaning through color with a handful of emphasis utility classes.</p>\r\n<div class="bs-docs-example">\r\n<p class="muted">Fusce dapibus, tellus ac cursus commodo, tortor mauris nibh.</p>\r\n<p class="text-warning">Etiam porta sem malesuada magna mollis euismod.</p>\r\n<p class="text-error">Donec ullamcorper nulla non metus auctor fringilla.</p>\r\n<p class="text-info">Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis.</p>\r\n<p class="text-success">Duis mollis, est non commodo luctus, nisi erat porttitor ligula.</p>\r\n</div>\r\n<pre class="prettyprint linenums">&lt;p class="muted"&gt;Fusce dapibus, tellus ac cursus commodo, tortor mauris nibh.&lt;/p&gt;\r\n&lt;p class="text-warning"&gt;Etiam porta sem malesuada magna mollis euismod.&lt;/p&gt;\r\n&lt;p class="text-error"&gt;Donec ullamcorper nulla non metus auctor fringilla.&lt;/p&gt;\r\n&lt;p class="text-info"&gt;Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis.&lt;/p&gt;\r\n&lt;p class="text-success"&gt;Duis mollis, est non commodo luctus, nisi erat porttitor ligula.&lt;/p&gt;</pre>\r\n</section>\r\n</div>\r\n<!-- Labels and badges\r\n================================================== -->\r\n<div class="page-header">\r\n<h1>Labels and badges</h1>\r\n</div>\r\n<h3>Labels</h3>\r\n<table class="table table-bordered table-striped">\r\n<thead>\r\n<tr><th>Labels</th><th>Markup</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td><span class="label">Default</span></td>\r\n<td><code>&lt;span class="label"&gt;Default&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td><span class="label label-success">Success</span></td>\r\n<td><code>&lt;span class="label label-success"&gt;Success&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td><span class="label label-warning">Warning</span></td>\r\n<td><code>&lt;span class="label label-warning"&gt;Warning&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td><span class="label label-important">Important</span></td>\r\n<td><code>&lt;span class="label label-important"&gt;Important&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td><span class="label label-info">Info</span></td>\r\n<td><code>&lt;span class="label label-info"&gt;Info&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td><span class="label label-inverse">Inverse</span></td>\r\n<td><code>&lt;span class="label label-inverse"&gt;Inverse&lt;/span&gt;</code></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Badges</h3>\r\n<table class="table table-bordered table-striped">\r\n<thead>\r\n<tr><th>Name</th><th>Example</th><th>Markup</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Default</td>\r\n<td><span class="badge">1</span></td>\r\n<td><code>&lt;span class="badge"&gt;1&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td>Success</td>\r\n<td><span class="badge badge-success">2</span></td>\r\n<td><code>&lt;span class="badge badge-success"&gt;2&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td>Warning</td>\r\n<td><span class="badge badge-warning">4</span></td>\r\n<td><code>&lt;span class="badge badge-warning"&gt;4&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td>Important</td>\r\n<td><span class="badge badge-important">6</span></td>\r\n<td><code>&lt;span class="badge badge-important"&gt;6&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td>Info</td>\r\n<td><span class="badge badge-info">8</span></td>\r\n<td><code>&lt;span class="badge badge-info"&gt;8&lt;/span&gt;</code></td>\r\n</tr>\r\n<tr>\r\n<td>Inverse</td>\r\n<td><span class="badge badge-inverse">10</span></td>\r\n<td><code>&lt;span class="badge badge-inverse"&gt;10&lt;/span&gt;</code></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- Code\r\n================================================== -->\r\n<div class="page-header">\r\n<h1>Code</h1>\r\n</div>\r\n<div class="accordion-body ">\r\n<div class=" first-child span6">\r\n<h2>Inline</h2>\r\n<p>Wrap inline snippets of code with <code>&lt;code&gt;</code>.</p>\r\n<div class="bs-docs-example">For example, <code>&lt;section&gt;</code> should be wrapped as inline.</div>\r\n<div class="prettyprint linenums"><ol class="linenums">\r\n<li class="L0"><span class="typ">For</span><span class="pln"> example</span><span class="pun">,</span><span class="pln"> </span><span class="str">&lt;code&gt;&lt;section&gt;</span><span class="pun">&lt;/</span><span class="pln">code</span><span class="pun">&gt;</span><span class="pln"> should be wrapped </span><span class="kwd">as</span><span class="pln"> </span><span class="kwd">inline</span><span class="pun">.</span></li>\r\n</ol></div>\r\n<p><strong>Note:</strong> Be sure to keep code within <code>&lt;pre&gt;</code> tags as close to the left as possible; it will render all tabs.</p>\r\n<p>You may optionally add the <code>.pre-scrollable</code> class which will set a max-height of 350px and provide a y-axis scrollbar.</p>\r\n</div>\r\n<div class="span6">\r\n<h2>Basic block</h2>\r\n<p>Use <code>&lt;pre&gt;</code> for multiple lines of code. Be sure to escape any angle brackets in the code for proper rendering.</p>\r\n<div class="bs-docs-example">\r\n<pre>   &lt;p&gt;Sample text here...&lt;/p&gt;</pre>\r\n</div>\r\n<pre class="prettyprint linenums" style="margin-bottom: 9px;">&lt;pre&gt;\r\n  &amp;lt;p&amp;gt;Sample text here...&amp;lt;/p&amp;gt;\r\n&lt;/pre&gt;</pre>\r\n</div>\r\n<div class="clear"> </div>\r\n<div class="span12">\r\n<h2>Prettify</h2>\r\n<p>To add colored syntax highlight to the <code>&lt;pre&gt;</code> tag, then use the <code>.prettyprint</code> class or the <code>.prettyprint linenums</code> class.</p>\r\n<div class="bs-docs-example">\r\n<pre class="prettyprint linenums">&lt;?php /** Begin Debug **/ if ($yt-&gt;countModules(''debug'')) : ?&gt;\r\n    &lt;div id="yt-debug"&gt;\r\n        &lt;div class="yt-container"&gt;\r\n            &lt;php echo $yt-&gt;displayModules(''debug'',''standard''); ?&gt;\r\n            &lt;div class="clear"&gt;&lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;?php /** End Debug **/ endif; ?&gt;</pre>\r\n</div>\r\n<pre class="prettyprint linenums" style="margin-bottom: 9px;">&amp;lt;?php /** Begin Debug **/ if ($yt-&gt;countModules(''debug'')) : ?&amp;gt;\r\n    &amp;lt;div id="yt-debug"&amp;gt;\r\n        &amp;lt;div class="yt-container"&amp;gt;\r\n            &amp;lt;php echo $yt-&gt;displayModules(''debug'',''standard''); ?&amp;gt;\r\n            &amp;lt;div class="clear"&amp;gt;&amp;lt;/div&amp;gt;\r\n        &amp;lt;/div&amp;gt;\r\n    &amp;lt;/div&amp;gt;\r\n&amp;lt;?php /** End Debug **/ endif; ?&amp;gt;</pre>\r\n</div>\r\n</div>\r\n</div>\r\n<section class="clearfix clear" style="padding: 2em 0;"><em>The documented typography above is a modified version of the reference guide available at: <a href="http://twitter.github.com/bootstrap/base-css.html">http://twitter.github.com/bootstrap/base-css.html</a></em></section>', '', 1, 9, '2011-10-31 10:10:56', 124, '', '2014-02-28 04:46:24', 315, 0, '0000-00-00 00:00:00', '2011-10-31 10:10:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 119, 11, '', '', 1, 589, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
