(198, 337, 'Powerfull Features', 'powerfull-features', '<div class="row-fluid ">\r\n<div class="span6">\r\n<h3>Joomla 2.5 and 3.0</h3>\r\n<p>YT Framework is available for Joomla 2.5 as well as Joomla 3.0 that means no matter which version of you joomla you like to use for developing your next website.</p>\r\n<p> </p>\r\n<h3>HTML5</h3>\r\n<p>We brought HTML5 in YT blank template to make elegant, modern and SEO friendly website that would be fully functional &amp; represents awesome typography.</p>\r\n<p> </p>\r\n<h3>Bootstrap</h3>\r\n<p><a href="joomla3/helix_ii/twitter.github.com/bootstrap/" target="_blank">Bootstrap</a> is made upon responsive CSS Designs with less code which enhances the overall look and feel of your website.</p>\r\n<p> </p>\r\n</div>\r\n<div class="span6">\r\n<p> </p>\r\n<h3>Wordpress</h3>\r\n<p>This is really great thing that YT Framework is available for most popular blogging platform Wordpress besides Joomla with tons of exciting features.  </p>\r\n<p> </p>\r\n<h3>CSS3</h3>\r\n<p>The latest CSS3 technology has been used in YT Framework - II to make the whole web development process easier and faster with lot of scopes.  </p>\r\n<p> </p>\r\n<h3>Presets</h3>\r\n<p>Presets manager give the flexibilty to change the design of your website without coding by selecting the desire color of your website background, header and footer etc.</p>\r\n</div>\r\n</div>', '', 1, 9, '2013-12-20 23:04:09', 124, '', '2014-03-11 04:55:47', 660, 124, '2014-05-18 19:31:40', '2013-12-20 23:04:09', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"",