(194, 0, 'For using special positions', '', '<p>Special positions are: sticky_left, sticky_right, notice, tool_bottom. You can use them for any module type. For using this, please go to Module Manager and config your module to your desired position.</p>\r\n<p><strong>You can disable by:</strong></p>\r\n<ul class="yt-list type-smallnumber4">\r\n<li>Go to Administrator » Template Manager » Your_Template » Tab: Advanced » Use special positions » select: No for all special positions</li>\r\n<li>Go to Administrator » Module magager » Your_Module(by postion: sticky_left/stickey_right/notice/tool_bottom) » Status: Unpublish for that module</li>\r\n</ul>', 1, 'sticky_right', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"  bg-white  @bullhorn","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(195, 0, ' Live chat ', '', '<div class="box-livesupport">\r\n	<p> To help us serve you better, please provide some information before we begin your chat.</p>\r\n	<div class="controls">\r\n		<input type="password" size="25" class="required" value="Full Name"  placeholder="Full Name" name="password">\r\n	</div>\r\n	<div class="controls">\r\n		<input type="text" size="25" class=" required" value="Email"  placeholder="Email" name="password">\r\n	</div>\r\n	<div class="controls">\r\n		<textarea maxlength="255" cols="30" rows="2" class="swifttextwide" id="chatsubject" placeholder="Your Question" placeholder="Your Question"name="subject"></textarea>\r\n	</div>\r\n	<div class="controls">\r\n		<button class="btn btn-primary validate" type="submit">Start Chat</button>\r\n		\r\n		<input type="hidden" value="com_users" name="option">\r\n		<input type="hidden" value="registration.register" name="task">\r\n		<input type="hidden" value="1" name="b3e225d79d411369fe9bebf173f6ecae">\r\n	</div>\r\n</div>', 1, 'tool_bottom', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"  bg-white  @comments-alt  ","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
